import california from '../src/images/california.png';

function Card() {
    return (
        <>
        <div className='col'>
            <div className="card" style= {{ width: '18rem', textAlign: 'center' }}>
                <img src={california} className="card-img-top" alt="..." />
                <div className="card-body">
                    <h5 className="card-title">California Roll</h5>
                    <p className="card-text">Euro 1.99</p>
                    <button className="btn btn-outline-danger">Elimina</button>
                </div>
            </div>
        </div>
        </>
    );
}

export default Card;
